import React, { Component } from 'react'
import { NavContainer } from './navbar'

export default class navbar extends Component {
  render() {
    return (
      <NavContainer>
        <h3>Plant</h3>
        <NavCenter>
          <ul>
            <li></li>
          </ul>
        </NavCenter>
        <NavButtonWrap>
          <Button>Login</Button>
          <Button>Sign</Button>
        </NavButtonWrap>
      </NavContainer>
    )
  }
}
